local function createNameTag()
    local nameTag = Instance.new("TextLabel")
    nameTag.Name = "NameTag"
    nameTag.Size = UDim2.new(0, 100, 0, 20)
    nameTag.BackgroundTransparency = 1
    nameTag.TextColor3 = Color3.fromRGB(255, 255, 255)
    nameTag.TextStrokeTransparency = 0.8
    nameTag.TextSize = 14
    nameTag.Font = Enum.Font.GothamBold
    nameTag.Text = Player.Name
    nameTag.Parent = Player.Character:WaitForChild("Head")
    
    local uiCorner = Instance.new("UICorner")
    uiCorner.CornerRadius = UDim.new(0, 8)
    uiCorner.Parent = nameTag
end

local function setName(name)
    if Player.Character and Player.Character:FindFirstChild("Head") then
        local nameTag = Player.Character.Head:FindFirstChild("NameTag")
        if nameTag then
            nameTag.Text = name
        end
    end
end

local function setSlap(slapAmount)
    -- Assuming slapAmount is the value for the slap clients (change as per your needs)
    -- In this case, it modifies the slap power or damage
    -- Replace this with actual code to modify slap damage or behavior
    Player.leaderstats.Slap.Value = slapAmount
end

ChatService.OnMessagePosted = function(message)
    if message:lower():sub(1, 9) == "/e setname" then
        local name = message:sub(11)
        setName(name)
    elseif message:lower():sub(1, 10) == "/e setslap" then
        local slapAmount = tonumber(message:sub(12))
        if slapAmount then
            setSlap(slapAmount)
        end
    end
end

